import React from 'react'

function Home() {
    return (
        <div className="Containar">
             <div className="row">
                 <div className="col"></div>
                 <div className="col"></div>
                 <div className="col" style={{backgroundColor}}></div>
             </div>
            
        </div>
    )
}

export default Home
